import React from 'react';
import Navigation from './Navigation/Navigation.jsx';
import UsersCRUD from '../Pages/Users/UsersCRUD.jsx';
import CreateUser from '../Pages/Users/CRUD/C/UserCreate.jsx';
import ReadUsers from '../Pages/Users/CRUD/R/UserRead.jsx';
import UserDetails from '../Pages/Users/CRUD/R/UserShow.jsx';
import MoviesCRUD from '../Pages/Movies/MoviesCRUD.jsx';
import RentsCRUD from '../Pages/Rents/RentsCRUD.jsx';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function Root() {
  return (
    <Router>
      <Navigation /> {/* Se muestra en todas las páginas */}
      <Routes>
        <Route path="/" element={<Navigation />} /> {/* Ruta de inicio */}
        <Route path="users/" element={<UsersCRUD />} /> {/* Ruta base para CRUD de usuarios */}
        <Route path="users/create" element={<CreateUser />} /> {/* Ruta para crear usuario */}
        <Route path="users/read" element={<ReadUsers />} /> {/* Ruta para leer usuarios */}
        <Route path="users/show/:id" element={<UserDetails />} /> {/* Ruta para detalles de usuario */}
        <Route path="movies/*" element={<MoviesCRUD />} /> {/* Ruta base para CRUD de películas */}
        <Route path="rents/*" element={<RentsCRUD />} /> {/* Ruta base para CRUD de alquileres */}
      </Routes>
    </Router>
  );
}

export default Root;
